import Home1 from './Home1';
import '../style/style.css'
import { BrowserRouter, Route } from 'react-router-dom';
import Home from './Home';
const App = () => {
 
    return (
        <div>
          <Home/>
         <BrowserRouter>
         <Route path='/search' exact component={Home1}/>
         </BrowserRouter>
          
        </div>
    );
};

export default App;
